  class Kanji {
    static dump() { return dictionary }

    static getDetails(character) {
      let details = null;
      for (let i = 0; i < dictionary.length; i++) {
        const word = dictionary[i];
        if (word.literal === character) {
          details = word;
          break
        }
      }

      return details
    }

    static search(options = {}) {
      let words = [];
      const { meaning, romaji, sort = true } = options;
  
      dictionary.forEach(word => {
          let score = 0;
  
          if (typeof meaning !== 'undefined') {
              const meaningSet = FuzzySet(word.meanings).get(meaning, null, 0.75);
              if (meaningSet !== null) score += meaningSet[0][0];
          }
  
          if (typeof romaji !== 'undefined') {
              const onyomiSet = FuzzySet(word.onyomi).get(toKatakana(romaji), null, 0.75);
              if (onyomiSet !== null) score += onyomiSet[0][0];
  
              const kunyomiSet = FuzzySet(word.kunyomi).get(toHiragana(romaji), null, 0.75);
              if (kunyomiSet !== null) score += kunyomiSet[0][0];
          }
  
          if (score > 0) words.push({ word, score });
      });
  
      if (sort) words.sort((a, b) => b.score - a.score);
      return words.map(item => item.word);
  }
  

    static random() {
      const random = Math.floor(Math.random() * (dictionary.length - 1));
      return dictionary[random]
    }

    constructor() {
      this.name = 'Kanji';
      this.version = '1.6.2';
    }
  }

